const totals={'First Year':{'1st Semester':{'lecture':152,'lab':24,'credit_units':176},'2nd Semester':{'lecture':176,'lab':16,'credit_units':192}},'Second Year':{'1st Semester':{'lecture':136,'lab':24,'credit_units':160},'2nd Semester':{'lecture':136,'lab':24,'credit_units':160}},'Third Year':{'1st Semester':{'lecture':120,'lab':24,'credit_units':144},'2nd Semester':{'lecture':112,'lab':32,'credit_units':144}},'Fourth Year':{'1st Semester':{'lecture':112,'lab':32,'credit_units':144},'2nd Semester':{'lecture':64,'lab':8,'credit_units':72}}};document.addEventListener("DOMContentLoaded",function(){for(const[year,semesters]of Object.entries(totals)){for(const[semester,details]of Object.entries(semesters)){document.getElementById(`lecture-${year}-${semester}`).innerText=details.lecture;document.getElementById(`lab-${year}-${semester}`).innerText=details.lab;document.getElementById(`credit_units-${year}-${semester}`).innerText=details.credit_units;}}});;